import React from 'react'
import ListGroup from 'react-bootstrap/ListGroup'

export default function Result(props) {
    const {items,showItems}=props;
    const displayItems=(items&&showItems)?items:'';
    return (
        <div>
            <ListGroup>
                <ListGroup.Item variant="success">{displayItems}</ListGroup.Item>
            </ListGroup>
        </div>
    )
}
